// SPDX-License-Identifier: MIT
// OpenZeppelin Contracts (last updated v4.8.2) (token/ERC721/ERC721.sol)

pragma solidity ^0.8.0;

import "./IERC721.sol";
import "./IERC721Receiver.sol";
import "./extensions/IERC721Metadata.sol";
import "../../utils/Address.sol";
import "../../utils/Context.sol";
import "../../utils/Strings.sol";
import "../../utils/introspection/ERC165.sol";

/**
  * https://eips.ethereum.org/EIPS/eip-721[ERC721] 대체 불가능한 토큰 표준의 @dev 구현
  * 메타데이터 확장, 하지만 다음과 같이 별도로 제공되는 Enumerable 확장은 포함하지 않음
  * {ERC721Enumerable}.
  */
contract ERC721 is Context, ERC165, IERC721, IERC721Metadata {
    using Address for address;
    using Strings for uint256;

    // 토큰 이름
    string private _name;

    // 토큰 기호, NFT를 식별하는 데 사용된다. ex) ETH
    string private _symbol;

    // 토큰 ID와 소유자 주소를 매핑
    mapping(uint256 => address) private _owners;

    // 소유자 주소를 토큰 수에 매핑
    mapping(address => uint256) private _balances;

    // 토큰 ID와 승인된 주소를 매핑
    mapping(uint256 => address) private _tokenApprovals;

    // 소유자에서 운영자 승인 값으로 매핑
    mapping(address => mapping(address => bool)) private _operatorApprovals;

    /**
      * @dev 토큰 수집에 `이름`과 `심볼`을 설정하여 컨트랙트를 초기화합니다.
      */
    constructor(string memory name_, string memory symbol_) {
        _name = name_;
        _symbol = symbol_;
    }

    /**
      * @dev {IERC165-supportsInterface}를 참조하십시오.
      */
    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns (bool) {
        return
            interfaceId == type(IERC721).interfaceId ||
            interfaceId == type(IERC721Metadata).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    /**
     * dev {IERC721-balanceOf}를 참조하세요.
     */
    function balanceOf(address owner) public view virtual override returns (uint256) {
        require(owner != address(0), "ERC721: address zero is not a valid owner");
        return _balances[owner];
    }

    /**
     * @dev {IERC721-ownerOf}를 참조하세요.
     */
    function ownerOf(uint256 tokenId) public view virtual override returns (address) {
        address owner = _ownerOf(tokenId);
        require(owner != address(0), "ERC721: invalid token ID");
        return owner;
    }

    /**
     * @dev {IERC721Metadata-name}을 참조하십시오.
     */
    function name() public view virtual override returns (string memory) {
        return _name;
    }

    /**
     * @dev See {IERC721Metadata-symbol}.
     */
    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    /**
     * @dev See {IERC721Metadata-tokenURI}.
     */
    function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
        _requireMinted(tokenId);

        string memory baseURI = _baseURI();
        return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, tokenId.toString())) : "";
    }

    /**
      * @dev {tokenURI} 컴퓨팅을 위한 기본 URI. 설정된 경우 각 항목에 대한 결과 URI
      * 토큰은 `baseURI`와 `tokenId`의 연결입니다. 비어 있는
      * 기본적으로 하위 계약에서 무시할 수 있습니다.
      * GPT : 토큰 URI의 기본값을 반환합니다.  이 기본값은 일반적으로 토큰의 메타데이터 URI에 대한 URL의 일부를 구성합니다.
      * 여기 잘 모르겠다.
      */
    function _baseURI() internal view virtual returns (string memory) {
        return "";
    }

    /**
     * @dev See {IERC721-approve}.
     */
    function approve(address to, uint256 tokenId) public virtual override {
        address owner = ERC721.ownerOf(tokenId);
        require(to != owner, "ERC721: approval to current owner");

        require(
            _msgSender() == owner || isApprovedForAll(owner, _msgSender()),
            "ERC721: approve caller is not token owner or approved for all"
        );

        _approve(to, tokenId);
    }

    /**
     * @dev See {IERC721-getApproved}.
     */
    function getApproved(uint256 tokenId) public view virtual override returns (address) {
        _requireMinted(tokenId);

        return _tokenApprovals[tokenId];
    }

    /**
     * @dev See {IERC721-setApprovalForAll}.
     */
    function setApprovalForAll(address operator, bool approved) public virtual override {
        _setApprovalForAll(_msgSender(), operator, approved);
    }

    /**
     * @dev See {IERC721-isApprovedForAll}.
     */
    function isApprovedForAll(address owner, address operator) public view virtual override returns (bool) {
        return _operatorApprovals[owner][operator];
    }

    /**
     * @dev See {IERC721-transferFrom}.
     */
    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        //solhint-disable-next-line max-line-length
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: caller is not token owner or approved");

        _transfer(from, to, tokenId);
    }

    /**
     * @dev See {IERC721-safeTransferFrom}.
     */
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        safeTransferFrom(from, to, tokenId, "");
    }

    /**
     * @dev See {IERC721-safeTransferFrom}.
     */
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) public virtual override {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: caller is not token owner or approved");
        _safeTransfer(from, to, tokenId, data);
    }

    /*
      * @dev는 `tokenId` 토큰을 `from`에서 `to`로 안전하게 전송하고 먼저 계약 수신자를 확인합니다.
      * 토큰이 영원히 잠기는 것을 방지하기 위해 ERC721 프로토콜을 알고 있습니다.
      *
      * `data`는 추가 데이터이며 지정된 형식이 없으며 `to` 호출로 전송됩니다.
      *
      * 이 내부 함수는 {safeTransferFrom}과 동일하며 예를 들어 다음과 같은 용도로 사용할 수 있습니다.
      * 서명 기반과 같은 토큰 전송을 수행하기 위한 대체 메커니즘을 구현합니다.
      *
      * 요구 사항:
      *
      * - `from`은 0 주소가 될 수 없습니다.
      * - `to`는 0 주소가 될 수 없습니다.
      * - `tokenId` 토큰이 존재해야 하며 `from`이 소유해야 합니다.
      * - `to`가 스마트 계약을 의미하는 경우 안전한 전송 시 호출되는 {IERC721Receiver-onERC721Received}를 구현해야 합니다.
      *
      * {Transfer} 이벤트를 내보냅니다.
      */
    function _safeTransfer(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) internal virtual {
        _transfer(from, to, tokenId);
        require(_checkOnERC721Received(from, to, tokenId, data), "ERC721: transfer to non ERC721Receiver implementer");
    }

    /**
     * @dev `tokenId`의 소유자를 반환합니다. 토큰이 존재하지 않으면 되돌리지 않습니다.
     */
    function _ownerOf(uint256 tokenId) internal view virtual returns (address) {
        return _owners[tokenId];
    }

    /**
      * @dev `tokenId`가 존재하는지 여부를 반환합니다.
      *
      * 토큰은 {approve} 또는 {setApprovalForAll}을 통해 소유자 또는 승인된 계정에서 관리할 수 있습니다.
      *
      * 토큰은 발행될 때(`_mint`) 존재하기 시작합니다.
      * 소각되면 존재하지 않습니다(`_burn`).
      */
    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return _ownerOf(tokenId) != address(0);
    }

    /**
      * @dev `spender`가 `tokenId`를 관리할 수 있는지 여부를 반환합니다.
      *
      * 요구 사항:
      *
      * - `tokenId`가 있어야 합니다.
      */
    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view virtual returns (bool) {
        address owner = ERC721.ownerOf(tokenId);
        return (spender == owner || isApprovedForAll(owner, spender) || getApproved(tokenId) == spender);
    }

    /**
      * @dev 안전하게 `tokenId`를 생성하고 `to`로 전송합니다.
      *
      * 요구 사항:
      *
      * - `tokenId`는 존재하지 않아야 합니다.
      * - `to`가 스마트 계약을 의미하는 경우 안전한 전송 시 호출되는 {IERC721Receiver-onERC721Received}를 구현해야 합니다.
      *
      * {Transfer} 이벤트를 내보냅니다.
      */
    function _safeMint(address to, uint256 tokenId) internal virtual {
        _safeMint(to, tokenId, "");
    }

    /**
      * @dev {xref-ERC721-_safeMint-address-uint256-}[`_safeMint`]와 동일하며 추가 `data` 매개변수는 다음과 같습니다.
      * {IERC721Receiver-onERC721Received}에서 계약 수신자에게 전달됩니다.
      */
    function _safeMint(
        address to,
        uint256 tokenId,
        bytes memory data
    ) internal virtual {
        _mint(to, tokenId);
        require(
            _checkOnERC721Received(address(0), to, tokenId, data),
            "ERC721: transfer to non ERC721Receiver implementer"
        );
    }

    /**
      * @dev `tokenId`를 만들고 `to`로 전송합니다.
      *
      * 경고: 이 방법은 사용하지 않는 것이 좋습니다. 가능하면 {_safeMint}를 사용하세요.
      *
      * 요구 사항:
      *
      * - `tokenId`는 존재하지 않아야 합니다.
      * - `to`는 0 주소가 될 수 없습니다.
      *
      * {Transfer} 이벤트를 내보냅니다.
      */
    function _mint(address to, uint256 tokenId) internal virtual {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        _beforeTokenTransfer(address(0), to, tokenId, 1);

        // `_beforeTokenTransfer` 후크에 의해 토큰 ID가 생성되지 않았는지 확인합니다.
        require(!_exists(tokenId), "ERC721: token already minted");

        unchecked {
             // 2**256개의 모든 토큰 ID가 동일한 소유자에게 발행되지 않는 한 오버플로우되지 않습니다.
             // 토큰이 하나씩 발행되는 것을 감안하면 현실적으로 불가능하다.
             // 이런 일이 발생합니다. 일괄 발행을 허용하면 변경될 수 있습니다.
             // ERC는 이 경우를 설명하지 못합니다.
            _balances[to] += 1;
        }

        _owners[tokenId] = to;

        emit Transfer(address(0), to, tokenId);

        _afterTokenTransfer(address(0), to, tokenId, 1);
    }

    /*
      * @dev는 `tokenId`를 파괴합니다.
      * 토큰이 소각되면 승인이 해제됩니다.
      * 발신자가 토큰에 대한 작업 권한이 있는지 확인하지 않는 내부 기능입니다.
      *
      * 요구 사항:
      *
      * - `tokenId`가 있어야 합니다.
      *
      * {Transfer} 이벤트를 내보냅니다.
      */
    function _burn(uint256 tokenId) internal virtual {
        address owner = ERC721.ownerOf(tokenId);

        _beforeTokenTransfer(owner, address(0), tokenId, 1);

        // `_beforeTokenTransfer` 후크에 의해 tokenId가 전송된 경우 소유권 업데이트
        owner = ERC721.ownerOf(tokenId);

        // 승인 지우기
        delete _tokenApprovals[tokenId];

        unchecked {
            // 더 많은 토큰을 소각/전송해야 하므로 오버플로할 수 없습니다.
            // Minting 및 Transfer in을 통해 초기에 소유자가 받은 것보다 out.
            _balances[owner] -= 1;
        }
        delete _owners[tokenId];

        emit Transfer(owner, address(0), tokenId);

        _afterTokenTransfer(owner, address(0), tokenId, 1);
    }

    /**
      * @dev `tokenId`를 `from`에서 `to`로 전송합니다.
      * {transferFrom}과 달리 msg.sender에 제한을 두지 않습니다.
      *
      * 요구 사항:
      *
      * - `to`는 0 주소가 될 수 없습니다.
      * - `tokenId` 토큰은 `from`이 소유해야 합니다.
      *
      * {Transfer} 이벤트를 내보냅니다.
      */
    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {
        require(ERC721.ownerOf(tokenId) == from, "ERC721: transfer from incorrect owner");
        require(to != address(0), "ERC721: transfer to the zero address");

        _beforeTokenTransfer(from, to, tokenId, 1);

        // `_beforeTokenTransfer` 후크에 의해 tokenId가 전송되지 않았는지 확인
        require(ERC721.ownerOf(tokenId) == from, "ERC721: transfer from incorrect owner");

        // 승인 지우기
        delete _tokenApprovals[tokenId];

        unchecked {
            // `_balances[from]`은 `_burn`에서 설명한 것과 같은 이유로 오버플로할 수 없습니다.
            // `from`의 잔액은 보유하고 있는 토큰의 수이며, 현재 최소 하나 이전입니다.
            // 옮기다.
            // `_balances[to]`는 `_mint`에 설명된 조건에서 오버플로될 수 있습니다. 그것은 요구할 것입니다
            // 모두 2**256개의 토큰 ID가 생성됩니다. 실제로는 불가능합니다.
            _balances[from] -= 1;
            _balances[to] += 1;
        }
        _owners[tokenId] = to;

        emit Transfer(from, to, tokenId);

        _afterTokenTransfer(from, to, tokenId, 1);
    }

    /**
      * @dev `to`가 `tokenId`에서 작동하도록 승인
      *
      * {승인} 이벤트를 내보냅니다.
      */
    function _approve(address to, uint256 tokenId) internal virtual {
        _tokenApprovals[tokenId] = to;
        emit Approval(ERC721.ownerOf(tokenId), to, tokenId);
    }

    /**
      * @dev 모든 `owner` 토큰에서 작동하도록 `operator` 승인
      *
      * {ApprovalForAll} 이벤트를 내보냅니다.
      */
    function _setApprovalForAll(
        address owner,
        address operator,
        bool approved
    ) internal virtual {
        require(owner != operator, "ERC721: approve to caller");
        _operatorApprovals[owner][operator] = approved;
        emit ApprovalForAll(owner, operator, approved);
    }

    /**
      * @dev `tokenId`가 아직 발행되지 않은 경우 되돌립니다.
      */
    function _requireMinted(uint256 tokenId) internal view virtual {
        require(_exists(tokenId), "ERC721: invalid token ID");
    }

    /**
      * @dev 대상 주소에서 {IERC721Receiver-onERC721Received}를 호출하는 내부 함수.
      * 대상 주소가 컨트랙트가 아닌 경우 호출이 실행되지 않습니다.
      *
      * 주어진 토큰 ID의 이전 소유자를 나타내는 주소에서 @param
      * @param 토큰을 받을 대상 주소
      * @param tokenId uint256 전송할 토큰의 ID
      * @param data bytes 호출과 함께 보낼 선택적 데이터
      * @return bool 호출이 예상 매직 값을 올바르게 반환했는지 여부
      */
    function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) private returns (bool) {
        if (to.isContract()) {
            try IERC721Receiver(to).onERC721Received(_msgSender(), from, tokenId, data) returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert("ERC721: transfer to non ERC721Receiver implementer");
                } else {
                    /// @solidity 메모리 안전 어셈블리
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }

    /**
      * @dev 토큰 전송 전에 호출되는 후크. 여기에는 주조 및 소각이 포함됩니다. {ERC721연속}인 경우
      * 사용 시 후크는 1보다 큰 'batchSize'로 표시되는 연속(배치) 민트의 일부로 호출될 수 있습니다.
      *
      * 호출 조건:
      *
      * - `from`과 `to`가 모두 0이 아닌 경우 `from`의 토큰이 `to`로 전송됩니다.
      * - `from`이 0이면 `to`에 대한 토큰이 발행됩니다.
      * - `to`가 0이면 `from`의 토큰이 소각됩니다.
      * - `from`과 `to`는 둘 다 0이 아닙니다.
      * - `batchSize`는 0이 아닙니다.
      *
      * 후크에 대해 자세히 알아보려면 xref:ROOT:extending-contracts.adoc#using-hooks[Using Hooks]로 이동하세요.
      */
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 firstTokenId,
        uint256 batchSize
    ) internal virtual {}

    /**
      * @dev 토큰 전송 후 호출되는 후크. 여기에는 주조 및 소각이 포함됩니다. {ERC721연속}인 경우
      * 사용 시 후크는 1보다 큰 'batchSize'로 표시되는 연속(배치) 민트의 일부로 호출될 수 있습니다.
      *
      * 호출 조건:
      *
      * - `from`과 `to`가 모두 0이 아닌 경우 `from`의 토큰이 `to`로 전송되었습니다.
      * - `from`이 0이면 `to`에 대한 토큰이 발행되었습니다.
      * - `to`가 0이면 `from`의 토큰이 소각되었습니다.
      * - `from`과 `to`는 둘 다 0이 아닙니다.
      * - `batchSize`는 0이 아닙니다.
      *
      * 후크에 대해 자세히 알아보려면 xref:ROOT:extending-contracts.adoc#using-hooks[Using Hooks]로 이동하세요.
      */
    function _afterTokenTransfer(
        address from,
        address to,
        uint256 firstTokenId,
        uint256 batchSize
    ) internal virtual {}

    /**
      * @dev 잔액에 대한 안전하지 않은 쓰기 액세스, {ownerOf} 재정의를 사용하여 토큰을 "민트"하는 확장 프로그램에서 사용.
      *
      * 경고: 이것을 호출하는 사람은 잔액이 소유권과 일치하는지 확인해야 합니다. 불변
      * 주소 `a`에 대해 `balanceOf(a)`에 의해 반환된 값은 해당 주소의 토큰 수와 같아야 합니다.
      * `ownerOf(tokenId)`는 `a`입니다.
     */
    // solhint-disable-next-line func-name-mixedcase
    function __unsafe_increaseBalance(address account, uint256 amount) internal {
        _balances[account] += amount;
    }
}

